description:
Residential real estate collateral is Real estate collateral that is defined as Residential property in Article 4(1)(75) of Regulation (EU) No 575/2013. 

Residential property as defined in Article 4(1)(75) of Regulation (EU) No 575/2013:
“residential property” means a residence which is occupied by the owner or the lessee of the residence, including the right to inhabit an apartment in housing cooperatives located in Sweden;
